
public class Equal {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int i=0;i<4;i++)
		{
			for(int j=0;j<6;j++)
			{
				System.out.print("=");
				if(j==2)
				{
					System.out.print("  ");
				}
				else {
					System.out.print(" ");
				}
			}
			System.out.println("");
		}
		}
	}


